import React, { Component } from 'react';

import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Switch, Route } from 'react-router-dom';
import uuid from 'uuid';

import Navi from './components/Navi';
import Abou from './components/Abou';
import Crea from './components/Crea';
import Help from './components/Help';
import Logi from './components/Logi';
import Sign from './components/Sign';
import Notf from './components/Notf';
import Inpu from './components/Inpu';
import List from './components/List';

import styled from 'styled-components';
import { Head } from './components/Head'

class App extends Component {
  render() {

    return (
      <React.Fragment>
        <Navi/>
        <Switch>
          <Route exact path="/" component={Abou} />
          <Route path="/Crea"   component={Crea} /> 
          <Route path="/Help"   component={Help} />
          <Route path="/Logi"   component={Logi} />
          <Route path="/Sign"   component={Sign} />
          <Route component={Notf} />
        </Switch>
        <div className="abou-img"></div>
        <div className="container">
          <div className="row">
            <div className="col-10 mx-auto col-md-8 mt-4">
              <h3 className="text-center"> Live interactive audience participation</h3>         
              <Abou />
            </div>
          </div>
        </div> 
      </React.Fragment>



    );
    }
  }

export default App;
